CREATE TABLE IF NOT EXISTS `crimes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `reported_date` varchar(50) NOT NULL,
  `suburb_incident` varchar(50) NOT NULL,
  `postcode_incident` int(11) NOT NULL,
  `offence_level_1` varchar(250) NOT NULL,
  `offence_level_2` varchar(250) NOT NULL,
  `offence_level_3` varchar(250) NOT NULL,
  `offence_count` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

